import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const Login = () => {
  const [cnic, setCnic] = useState("");
  const [password, setPassword] = useState("");
  const [rememberMe, setRememberMe] = useState(false);
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("http://localhost:5000/voter/login", {
        cnic,
        password,
      });
      alert("Login successful!");
      console.log(response.data);

      // Redirect to the welcome page after successful login
      navigate("/welcome");
    } catch (error) {
      alert("Login failed. Please check your CNIC and password.");
      console.error(error);
    }
  };

  // Container styling for centering and background
  const containerStyle = {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    minHeight: "100vh",
    backgroundColor: "#f5f5f5", // Light grey background to match portal
    padding: "20px",
  };

  // Form box styling with shadow and responsive width
  const formStyle = {
    background: "#ffffff", // White background for form
    padding: "2rem",
    borderRadius: "10px",
    boxShadow: "0 4px 10px rgba(0, 0, 0, 0.2)",
    width: "100%",
    maxWidth: "400px",
  };

  const formGroupStyle = {
    marginBottom: "1rem",
  };

  const labelStyle = {
    display: "block",
    marginBottom: "0.5rem",
    fontWeight: "bold",
    fontFamily: "'Roboto Slab', serif", // Slab font for labels
    fontSize: "16px",
  };

  const inputStyle = {
    width: "100%",
    padding: "0.8rem",
    border: "1px solid #ddd",
    borderRadius: "5px",
    fontSize: "16px",
  };

  const formOptionsStyle = {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    marginBottom: "1rem",
  };

  const buttonStyle = {
    width: "100%",
    padding: "0.8rem",
    border: "none",
    borderRadius: "5px",
    background: "#1a2b2d", // Dark color for consistency
    color: "white",
    fontSize: "1rem",
    cursor: "pointer",
    transition: "background-color 0.3s ease",
    fontWeight: "500", // Stronger text weight for button
  };

  const buttonHoverStyle = {
    background: "#0072ff", // Hover effect for the button
  };

  const linkStyle = {
    textAlign: "center",
    marginTop: "1rem",
    fontSize: "14px",
  };

  const signupSpanStyle = {
    color: "#00c6ff", // Blue color for signup link
    cursor: "pointer",
  };

  return (
    <div style={containerStyle}>
      <form style={formStyle} onSubmit={handleLogin}>
        <h2 style={{ textAlign: "center", marginBottom: "1.5rem", fontFamily: "'Roboto Slab', serif", fontSize: "24px" }}>
          Login
        </h2>
        <div style={formGroupStyle}>
          <label htmlFor="cnic" style={labelStyle}>
            CNIC
          </label>
          <input
            type="text"
            id="cnic"
            placeholder="Enter your CNIC"
            value={cnic}
            onChange={(e) => setCnic(e.target.value)}
            style={inputStyle}
            required
          />
        </div>
        <div style={formGroupStyle}>
          <label htmlFor="password" style={labelStyle}>
            Password
          </label>
          <input
            type="password"
            id="password"
            placeholder="Enter your password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            style={inputStyle}
            required
          />
        </div>
        <div style={formOptionsStyle}>
          <label>
            <input
              type="checkbox"
              checked={rememberMe}
              onChange={() => setRememberMe(!rememberMe)}
            />
            Remember me
          </label>
          <a href="#" style={{ color: "#00c6ff", fontSize: "14px" }}>
            Forgot password?
          </a>
        </div>
        <button
          type="submit"
          style={buttonStyle}
          onMouseOver={(e) => (e.target.style.background = buttonHoverStyle.background)}
          onMouseOut={(e) => (e.target.style.background = "#1a2b2d")}
        >
          Login Now
        </button>
        <div style={linkStyle}>
          Not a member?{" "}
          <span
            onClick={() => navigate("/signup")}
            style={signupSpanStyle}
          >
            Signup Now
          </span>
        </div>
      </form>
    </div>
  );
};

export default Login;
